function anyWordInStringStartsWith(thisStr, substr){ //return true if any of the multiple words in a string thisStr starts with the give substring

    var aWordStartsWith = false;

    if( thisStr.toLowerCase().startsWith( substr.toLowerCase() ) ){ //check first match to the complete string
        aWordStartsWith = true;
        return true
    }

    var strSplit = thisStr.split(" ");
    for (var i = 0; i < strSplit.length; i++) { //check word by word separately

        var thisWord = strSplit[i];

        if( thisWord.toLowerCase().startsWith( substr.toLowerCase() ) ){
            aWordStartsWith = true;
            return true
        }
    }

    return aWordStartsWith
}


