function govDictUK(tm){
  //   Grams of CO2 / pkm depending on transport mode. According to gov.uk.
  //
  //   source: https://www.gov.uk/government/publications/greenhouse-gas-reporting-conversion-factors-2019
  //   https://docs.google.com/spreadsheets/d/1LzrAnx-NK0panXBKFvsqJUwYQPOv10FN/edit#gid=1090833567
  //   units: g/pax*km

  grCO2dict = {
                0: { //business travel air
                    'domestic': {'avg': 255},
                    'short-haul': {'avg': 158, 'Y/C': 156, 'B/C': 234}, //up to 3700 km
                    'long-haul': {'avg': 196, 'Y/C': 150, 'Premium Y/C': 240, 'B/C': 434, 'First class': 599}, //over 3700 km
                }, //src: "https://docs.google.com/spreadsheets/d/1LzrAnx-NK0panXBKFvsqJUwYQPOv10FN/edit#gid=1447343703"
                1: {
                    'international': 6,
                    'uk': 41,
                    },
                2: {
                    'coach': 28,
                    },
                4: { // 1 px
                    'diesel': 173,
                    'petrol': 181,
                    'electric': 60, //uk
                    },
                5: {
                    'foot_pax': 19,
                    'car_pax': 130,
                }, //ferry | pax-avg: ?
    }

    grCO2 = grCO2dict[tm]

    return grCO2;
}

function electricRailEmissions(countryCode){
    // Return gr CO2 / pkm for electric trains depending on the country.

    var electricConsumption = 0.108 // kWh / pkm for electric trains. Source: https://www.railplus.com.au/pdfs/ATOC-rail-is-greener-report.pdf

    if (countryCode == 'DE'){
        // See
        // https://ib.deutschebahn.com/ib2018/de/konzernlagebericht/oekologie/fortschritte-im-klimaschutz/anteil-erneuerbarer-energien-auf-hohem-niveau/
        // and
        // https://docs.google.com/spreadsheets/d/1gxMfqTNyyo8oJEU3__MqZ68T97Hl0466mDHsCTvGbE0
        // gCO2_per_kWh = 258 //2018
        gCO2perkWh = 230; //2019 #https://www.deutschebahn.com/resource/blob/5029910/5bdee6f2cac4fc869ad491d141539be9/Integrierter-Bericht-2019-data.pdf
    } else if (countryCode == 'AT'){
        gCO2perkWh = 59 // See https://docs.google.com/spreadsheets/d/1gxMfqTNyyo8oJEU3__MqZ68T97Hl0466mDHsCTvGbE0
    } else {
        // Spain is 80% electric and 20% diesel: https://www.renfe.com/es/es/grupo-renfe/transporte-sostenible/eficiencia-energetica.html
        gCO2perkWh = co2Intensity4Electricity(countryCode)
    }

    var railCarbonEmissions = electricConsumption * gCO2perkWh;

    return railCarbonEmissions;
}


