function parseDuration(durationStr){
    var durationSplit = durationStr.split('h');

    if (durationStr.indexOf("m") >= 0){
        var minutes = parseInt(durationSplit[1].replace('m',''));
    } else {
        var minutes = 0;
    }

    var hours = parseInt(durationSplit[0])

    var totalMinutes = parseInt(hours)*60 + minutes
    console.log('totalMinutes:', totalMinutes)

    return totalMinutes
}


