function realDistance(iataOrig, iataDest){
    // Calculate real distance between airports, given two airport iata codes.

    origAirportDict = airportsJson[iataOrig];
    destAirportDict = airportsJson[iataDest];

    distKm = haversineDistance(origAirportDict["lonlat"][1], origAirportDict["lonlat"][0], destAirportDict["lonlat"][1], destAirportDict["lonlat"][0]);

    console.log('Real distance between', iataOrig, 'and', iataDest, ':', distKm, 'km');

    return distKm;
}



function haversineDistance(lat1, lon1, lat2, lon2){
// Calculate the haversine in kilometers. Source: https://stackoverflow.com/a/14561433/5802289
function toRad(x) {
    return x * Math.PI / 180;
}

var R = 6371; // km
var x1 = lat2-lat1;
var dLat = toRad(x1);
var x2 = lon2-lon1;
var dLon = toRad(x2);
var a = Math.sin(dLat/2) * Math.sin(dLat/2) +
                Math.cos(toRad(lat1)) * Math.cos(toRad(lat2)) *
                Math.sin(dLon/2) * Math.sin(dLon/2);
var c = 2 * Math.atan2(Math.sqrt(a), Math.sqrt(1-a));
var d = R * c;

return d;
}

function averageSpeedFromDuration(hour) {
  // Adapted from https://airasia.listedcompany.com/images/ir-speed-length_7.gif, could be improved!
  if (hour < 3.3) {
    return (
      14.1 +
      495 * hour -
      110 * hour * hour +
      9.85 * hour * hour * hour -
      0.309 * hour * hour * hour * hour
    );
  }
  return 770;
}


function distanceFromDuration(hour) {
    return averageSpeedFromDuration(hour) * hour;
}


