function assignTransportInfo(data, modeOfTransportation){

  var language = document.getElementById("language").getAttribute("data-language");

  var tmText = "";

  if (data.tm == 4){
      tmText = assignCarType(language, data)
  } else {
      tmText = modeOfTransportation[0].toUpperCase() + modeOfTransportation.slice(1);

      if (data.tm == 1 && data.trainEnergy == 'electric' && data.trainCountry != "average"){
          if (language == "es"){
              tmText = tmText + " en " + data.trainCountry;
          } else {
              tmText = tmText + " in " +  data.trainCountry;
          }
      } else if (data.tm == 5 && data.vehicleFerry == "with-vehicle"){
          if (language == "es"){
              tmText = tmText + " incl. vehículo";
          } else if(language == "de"){
              tmText = tmText + " inkl. Fahrzeug";

          } else {
              tmText = tmText + " incl. vehicle";
          }
      }

  }

  return tmText

}


