function getLegTitle(distanceOrDuration, modeOfTransportation, data){
    distanceOrDuration = distanceOrDuration.replace('h', 'h ').replace('-', ' ');
    distanceOrDurationSplit = distanceOrDuration.split(' ');
    if (distanceOrDurationSplit[0] == '0h'){
        distanceOrDuration = distanceOrDuration.replace('0h ', '');
    }

    var language = document.getElementById("language").getAttribute("data-language");
    if (language == 'de'){
        distanceOrDurationTranslated = distanceOrDuration.replace('h', ' Std.')
        if (distanceOrDurationTranslated.indexOf("km") == -1){
            distanceOrDurationTranslated.replace('m', ' Min.');
        }
    } else {
        distanceOrDurationTranslated = distanceOrDuration;
    }

    if (data.tm == 0 && data.iataAirports){
        legTitle = data.iataOrig + ' - ' + data.iataDest
    } else {
        legTitle = distanceOrDurationTranslated + ' ' + modeOfTransportation;
        legTitle.replace("  ", "");
    }

    console.log('legTitle:', legTitle);
    return legTitle;
}


